import { useEffect, useState } from "react";
import API from "../api";
import { Carousel } from "react-bootstrap";
import "../css/about.css"; // <-- import CSS

export default function AboutPage() {
  const [about, setAbout] = useState(null);
  const [flipped, setFlipped] = useState(false);
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const fetchAbout = async () => {
      try {
        const res = await API.get("/about");
        setAbout(res.data);
      } catch (err) {
        console.error(err);
      }
    };
    fetchAbout();
  }, []);

  useEffect(() => {
    const handleResize = () => setIsMobile(window.innerWidth < 768);
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  if (!about) return <p>Loading...</p>;
  const baseURL = "http://localhost:5000";

  const LazyImage = ({ src, alt, className }) => {
    const [loaded, setLoaded] = useState(false);
    const finalSrc = src.startsWith("http") ? src : baseURL + src;
    return (
      <div className={className}>
        <img
          src={finalSrc}
          alt={alt}
          loading="lazy"
          onLoad={() => setLoaded(true)}
          style={{
            opacity: loaded ? 1 : 0,
            transition: "opacity 0.5s ease-in-out",
          }}
        />
      </div>
    );
  };

  return (
    <div className="about-container">
      {/* Poster + Description */}
      {!isMobile ? (
        <div className="about-card">
          {about.poster && (
            <div className="about-poster">
              <img
                src={about.poster.startsWith("http") ? about.poster : baseURL + about.poster}
                alt="Poster"
              />
            </div>
          )}
          <div className="about-description">
            <p>{about.description}</p>
          </div>
        </div>
      ) : (
        <div className="flip-card">
          <div
            className="flip-card-inner"
            onClick={() => setFlipped((prev) => !prev)}
            style={{ transform: flipped ? "rotateY(180deg)" : "rotateY(0deg)" }}
          >
            <div className="flip-card-front">
              <img src={about.poster.startsWith("http") ? about.poster : baseURL + about.poster} alt="Poster" />
            </div>
            <div className="flip-card-back">
              <p>{about.description}</p>
            </div>
          </div>
        </div>
      )}

      {/* Gallery Carousel */}
      {about.gallery.length > 0 && (
        <Carousel className="about-carousel mb-4" interval={3000} pause="hover">
          {about.gallery.map((img, idx) => (
            <Carousel.Item key={idx}>
              <LazyImage src={img} alt={`Gallery ${idx}`} className="about-carousel" />
            </Carousel.Item>
          ))}
        </Carousel>
      )}

      {/* Schedule */}
      <h3>Schedule</h3>
      <ul className="about-schedule">
        {about.schedule.map((s, idx) => (
          <li key={idx}>
            {s.date} - {s.event} ({s.time})
          </li>
        ))}
      </ul>

      {/* Sponsors */}
      <h3>Sponsors</h3>
      <div className="about-sponsors">
        {about.sponsors.map((s, idx) => (
          <div key={idx} className="about-sponsor-card">
            <LazyImage src={s.logo} alt={s.name} />
          </div>
        ))}
      </div>
    </div>
  );
}
